					WHERE CCD.CPP_Codigo=CODIGO_FACTURA;
					DECLARE CONTINUE HANDLER FOR NOT FOUND SET @EJECUTARDC1 = TRUE;
					OPEN COMPROBANTED_CURSORMODI;
					LOOP2: LOOP
					FETCH COMPROBANTED_CURSORMODI INTO 
					D_CPDEP_Codigo,
