CREATE DEFINER=`root`@`localhost` PROCEDURE `CREACION_GUIA_INTERNA` (IN `CODIGOCOMPROBANTE` INT(11), IN `DOCUP_Codigo` INT(2), IN `CPC_TipoOperacion` VARCHAR(1))  BLOCKCGI:BEGIN
	DECLARE DC_ALMAP_Codigo INT(11); 
