							END LOOP LOOPSE21;
							CLOSE SERIES_CURSOR;
						END BLOCKSE1;	
						
					END IF;
					
					
					
					
					
					
					
					SET INDICEPOSICIOND=INDICEPOSICIOND+1;
					END LOOP LOOP2; 
					CLOSE COMPROBANTED_CURSORMODI;
				END BLOCK12;
	
	CALL 	MANTENIMIENTO_COMPROBANTE_GUIAREM('',CODIGOCOMPROBANTE,@GUIAREMP_Codigo,3,0);
	
	
	
	END LOOP LOOP1GIN; 
	CLOSE ALMACENDC_CURSOR;
